import React ,{Component} from "react";
import Counter from "./Counter";
import  FormPage from "./Cont";
import ArrowDropUpIcon from '@material-ui/icons/ArrowDropUp';
import './App.css';
import "./Header.css";

class App extends Component{
  render(){
    return (
      <div className="App">
        <div className="header">
          <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/e/ef/Stack_Overflow_icon.svg/768px-Stack_Overflow_icon.svg.png"></img>       


        </div>
       <Counter/>
      </div>
    )
  }



}

export default App;
